import math
print('Square root of 81 is :', math.sqrt(81))
print('Factorial of 6 is :', math.factorial(6))
print('math.ceil(3.4) :', math.ceil(3.4))
print('math.floor(3.4) :', math.floor(3.4))
print('absolute value  :', math.fabs(-3.5))
print('sin90 :', math.sin(math.radians(90)))
print('cose30 :', math.cos(math.radians(30)))
print('tan45 :', math.tan(math.radians(45)))